import './DoctorLogin.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function DoctorLogin() {
    const[signUp, setSignUp] = useState(false);
    const[signIn, setSignIn] = useState(false);
    const[email, setEmail] = useState("");
    const[password, setPassword] = useState("");
    const [name, setName] = useState("");
    const [dob, setDob] = useState("");

    const navigate = useNavigate();

    // Handle choice between sign up and sign in
    const handleChoice = (input) => {
        if (input === "sign up") {
            setSignUp(true);
        } else if (input === "sign in") {
            setSignIn(true);
        }
    }

    // Handle sign in 
    const handleSignIn = () => {

    }

    return (
        <div>
            <h1>Doctor</h1>

            {!signIn && !signUp ? (
                <div className="account-container">
                    <button className="account-button" onClick={() => handleChoice("sign in")}>Sign In</button>
                    <button className="account-button" onClick={() => handleChoice("sign up")}>Create An Account</button>
                </div>
            ): null}

            {signIn ? (
                <div>
                    <form className="doctor-form">
                        <div className="doctor-form-item">
                            <label>Email:</label>
                            <input 
                                type="text"
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                            />
                        </div>
                        <div className="doctor-form-item">
                            <label>Password:</label>
                            <input 
                                type="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                />
                        </div>
                        <button onClick={handleSignIn} type="submit">Sign In</button>
                    </form>
                    <button onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}

            {signUp ? (
                <div> 
                    <form className="doctor-form">
                        <div className="doctor-form-item">
                            <label>Name:</label>
                            <input 
                                type="text"
                            />
                        </div>
                        <div className="doctor-form-item">
                            <label>Email:</label>
                            <input 
                                type="email"
                            />
                        </div>
                        <div className="doctor-form-item">
                            <label>Password:</label>
                            <input 
                                type="password"
                            />
                        </div>
                        <div className="doctor-form-item">
                            <label>Date of Birth:</label>
                            <input 
                                type="date"
                            />
                        </div>
                        <div className="doctor-form-item">
                            <label>Gender:</label>
                            <select>
                                <option></option>
                                <option>Male</option>
                                <option>Female</option>
                            </select>
                        </div>
                        <div className="doctor-form-item">
                            <label>Phone:</label>
                            <input 
                                placeholder="123-456-7890"
                            />
                        </div>
                        <button type="submit">Sign Up</button>
                    </form>
                    <button onClick={() => setSignUp(false)}>Back</button>
                </div>
            ) : null}
        </div>
    )
}
